		"TBAppDescription": "Ever catch yourself forgetting life\u2019s moments? Imagine a movie that includes every day of the rest of your life. Let 1 Second Everyday help you remember your journey and create the story of your life. Get started with 1SE today!\n\n2x winner of the \u201cBest Use of a Mobile Camera\u201d WEBBY Award.\n\nFeatured by Apple, BBC, TED, CNN, Fast Company and more! \n\n\"For over 6 years, I've been recording 1 second every day, so I'll never forget another day ever again. This project has had such a positive impact on my life. This lead to the development of 1 Second Everyday; which makes it easy for anyone to do this too. Being able to relive every single day has provided me with a treasured perspective on life. It holds me accountable for making each day notable. When I turn 40, I'll have a 1 hour compilation that encapsulates my 30s. If I live to see 80 years of age, I'll have a 5-hour video that summarizes 50 years of my life.\"\n\n- Cesar Kuriyama, 1SE Founder\n\nWhy 1SE is awesome:\n- MULTIPLE SNIPPETS: Some days have so much going on, our classic project now allows up to two separate snippets in a day.\n\n- AUTO-SELECT: Don't know how to start? Roll the dice and auto fill your days with ease! \n\n- ROTATE & FILL THE FRAME: Pesky vertical videos? Begone! Lopsided videos ruining your mash? No more! You can now rotate and fill the frame to your heart's content.\n\n- UNLIMITED MASHING: Make 1SE videos of any custom length. Monthly, seasonal, or the past 5 years. You're in control.\n\n- NOTES: Take note of your day and leave a private message for yourself.\n\n- MOOD: There so many ways to remember your day, now you can remember how you were feeling! Get an at-a-glance view of your mood for the day with our newest tracking feature.\n\n- REMINDERS: Set up friendly creative reminders so you never forget a day!\n\n- PRIVACY: They are never shared with anyone unless you decide to do it.\n\n\n1SE PRO subscription includes:\n\u2022 Unlimited Backup\n\u2022 Music Editor\n\u2022 Longer Snippets\n\u2022 Remove 1SE Branding\n\u2022 Brightness & Volume Control\n\u2022 Priority Support\n\u2022 Easy Access to Future Features\n\n1SE PRO is an auto-renewing subscription. There are two auto-renewing subscription options:\n\n$3.99 Monthly\n$29.99 Yearly\n\nThese prices are for United States customers. Pricing in other countries may vary and actual charges may be converted to your local currency depending on the country of residence.\n\nAccount will be charged for renewal within 24-hours prior to the end of the current period. Your PRO subscription will automatically renew unless auto-renew is turned off at least 24 hours before the end of the current period. You can go to your iTunes Account settings to manage your subscription and turn off auto-renew. Payment will be charged to iTunes Account at confirmation of purchase. Per Apple policy, no cancellation of the current subscription is allowed during active subscription period. Once purchased, refunds will not be provided for any unused portion of the term. Any unused portion of a free trial period, if offered, will be forfeited when the user purchases a subscription to that publication, where applicable.\n\nPRO & Subscription FAQ: https:\/\/help.1se.co\/faq\nPrivacy Policy: https:\/\/1se.co\/privacy\/\nTerms of Use: https:\/\/1se.co\/terms-service\n\n\nWe love your feedback and appreciate your reviews. Reach out to us at support@1secondeveryday.com\n\nFollow 1SE on:\n- Instagram: @1SecondEveryday\n- Twitter: @1SecondEveryday\n- Facebook: https:\/\/www.facebook.com\/1SecondEveryday",
