		"TBAppDescription": "Meet the ultimate solution for preserving your old photos. Photomyne is the fastest and easiest way to turn photographs into live digital records, and to share them with others. Download to see the magic of powerful scanning action, built with cutting edge AI technology.\n\nSIMPLY HOLD & CAPTURE - SCANNER WILL DO THE REST\n* Scan multiple analog photographs in a single shot\n* Scan an entire photo album in minutes\n* Photo scanner auto-detects picture boundaries, auto-rotates sideways pics, crops and saves them into a digital album\n\nEDIT & RESTORE NEWLY SCANNED PHOTOS\n* Edit photos - add tags of location, dates and names\n* Apply your choice of photo filters \n* Add the story behind the photos: Give albums a title and\/or date range\n\nSAVE & SHARE YOUR REDISCOVERED MEMORIES\n* Save photos to your phone or computer\n* Share as many photos as you want via email, text message and more\n* Share an entire album as-is with another Photomyne user\n* Explore Discover - a visual history feed of other Photomyne users\u2019 photos and their stories\n\nThis paid app version offers the full utility power of Photomyne on one iOS device. You will need to subscribe to a Photomyne account (in-app subscription) to access your photos on other devices or online, and to enjoy supporting cloud services.\n\n==\n\nOPTIONAL IN-APP SUBSCRIPTION:\n\nEnjoy additional features when you subscribe to Photomyne** (recurring annual subscription account)\n\n* Unlimited photo saving to your iOS device\n* Unlimited albums\n* Unlimited photo backup\n* Photomyne account sync across multiple mobile devices\n* Online photo access on the Photomyne website\n* Free up space on your device while keeping photos safe and backed-up on the cloud\n\n**A Photomyne account offers the added features above through an auto-renewing subscription. The subscription will be charged to your credit card through your iTunes account. Your subscription will automatically renew unless cancelled at least 24-hours before the end of the current period. Account will be charged for renewal within 24-hours prior to the end of the current period. You will not be able to cancel a subscription during the active period. Manage your subscriptions in your account.\n\nFor more information on Photomyne's Terms of Use, please visit photomyne.com\/terms-of-use.\n\nStop by and learn more at: photomyne.com",
