		"TBAppDescription": "J.R. Bookwalter, Macworld: \u201cDesktop-quality image masking and editing tools. For extracting objects from images and repurposing them in a variety of different ways, Pixomatic 3 has no equal on smartphones or tablets.\u201d \n\n#1 Paid App in 92 Countries and #1 Paid Photo & Video App in 122 Countries. Featured by Apple in \u201cGreat Photography Apps\u201d, \u201cNew Apps We Love\u201d & \u201cShare the Fever\u201d on the App Store in more than 20 countries.\n \nPixomatic is the first-ever mobile app that brings desktop level quality for selecting and masking images. Now, you have no problems with cutting out even the most difficult picture elements, including hair! Smoothly select and mask even the trickiest hair edges.\nAlso, we introduce hundreds of photo stickers that you can add to your photos with a single tap. In just a few minutes create funny pranks, visual art and social media posts for your business or stunning photo manipulations, viral memes and selfies to share with friends. Pixomatic has a full range of amazing photo editing tools for creative minds. Use smart cutout, add layers, apply blending modes and unique filters to create epic masterpieces. Let Pixomatic be your only all-in-one photo editor!\n \nWhat users tell about us:\n \n\"Can't believe how easy this app is to use. Really useful for cutting out products from background and in general use its better and quicker than Photoshop.\"- Boydyonline.\n \n\"This is the best photo app on a smartphone to date I've used and I'm a photo technician.\"- Bluetiger69.\n \n\"This is the app to have,10 times better than Photoshop. A must to edit pictures on the go worth it for sure.\" - by Marco Red Bull.\n \n\"Cutting out images of flying pies to paste into my friends' pictures has never been easier.\" - by runningsealey.\n \nPixomatic offers:\n \nAwesome Cutouts\n\u2022 Cut out, replace, and remove image elements\n\u2022 Select, mask and easily cut out even the trickiest hair (first time ever on iPhone and iPad)\n\u2022 Pixomatic also makes it easy to save your cutouts and edits in a dedicated album for future use\n \nHundreds of photo stickers\n\u2022 Intentionally photobomb friends\u2019 pics by adding funny animal stickers to them\n\u2022 Play pranks on friends through editing their photos with one of the hand stickers\n\u2022 Choose from a variety of holiday stickers and spooky backgrounds in the \u201cPacks\u201d section\n \nDouble Exposure\n\u2022 Fuse two photos together to create amazing surrealistic creations\n\u2022 Overlay two pics and use the \u201cBlend\u201d effect to merge them\n\u2022 Add color, resize, and refine your artwork to achieve even more awesome results\n \nSmart Photo Tools\n\u2022 Blur backgrounds for depth of field\n\u2022 Use the \u201cDistort\u201d tool to reshape specific elements\n\u2022 Clone as many pics as you want\n\u2022 Add shadows, blur them or play with their shape and opacity\n\u2022 Flip horizontally or vertically or simply change the image perspective\n\nDuo and Art Filters\n\u2022 Seamlessly transform your photos into artistic creations\n\u2022 Feel like a painter through experimenting with the awesome artistic style transfer filters\n \nStandard Effects\n\u2022 Adjust a whole lot of features like warmth, contrast, hue, exposure, shadow etc.\n\u2022 Add text, change the fonts, text color, alignment as well as shadows and opacity\n \nGet creative!\nFollow our Facebook and Instagram accounts for tips and inspiration.\nGet useful iPhone photography tips from us and expert editing advice from our top users on Pixomatic Blog (www.blog.pixomatic.us).   \nPost your gorgeous edits on Instagram with #pixomatic. We\u2019ll feature our favorites!\nContact us at support@pixomatic.us if you have any feature requests, questions, or comments.",
