		"TBAppDescription": "This is a smart ballistic calculator. It can use G1, G7 and... custom drag-functions!\nCan calculate trajectory without using ballistic coefficient!\nYou can select reticle from the list (1367 reticles!) and see holdovers at any magnification (see list of reticles supported here http:\/\/www.borisov.mobi\/StrelokPro\/ios\/reticles.html)\n3352 cartridges database\n1584 bullets database\nCan calculate spin drift, Coriolis effect, gyroscopic stability factor and vertical deflection of crosswind.\niPhone 6 internal barometer support\nKestrel Drop and Kestrel 5x00 support (Will NOT work on iPhone 4, 3GS, 3G or iPad 1, 2)\nSupports imperial and metric units.\nSupports WeatherFlow WINDmeter \nSupports WeatherFlow WEATHERmeter (Will NOT work on iPhone 4, 3GS, 3G or iPad 1, 2)\nSkywatch BL weather meter support (Will NOT work on iPhone 4, 3GS, 3G or iPad 1, 2)\nDensity Altitude support\n\nField-proven accuracy since 2007",
