		"TBAppDescription": "- The Best Stock Market Apps for iPhone and iPad 2017. Thebalance.com\n- Best Stock Market App for iPhone in 2014 - About.com.\n- Stock Market App to Boost Your Portfolio - TheStreet.com. \nStocks Live is an amazing way to track the stocks you know and discover new winners. Securely sync and trade your portfolios with major brokers anywhere, anytime.\n\n-- FEATURE HIGHLIGHTS \n- Free sync & trade with major brokers (including coinbase).\n- Unique Heat map visualization, with dancing tiles** \n- Cryptocurrency support, 1500+ alt coin. \n- Real-time quotes* (with extended hours). Auto-refresh every 20 seconds, also manual refresh of quotes on demand. \n- Global coverage similar to Yahoo! Finance (including China, Japan, Taiwan, Hong Kong and more). \n- Buy\/Sell signal that works (look for the heart)**. \n- Unlimited multi-currency portfolios that work. \n- Native Twitter & Evernote integration. \n- Unlimited watch lists (tested with more than 10,000 stocks per watch list!). Easily create watch lists with as many stocks as you want. \n- 450+ market activities, scans and user-defined filters. No app can claim such collection with such price. Another 450+ scanner as in-app.\n- Earning and Ex-dividend date calendar**.\n- iCloud enabled (must be logged into iCloud). Sync and backup your portfolios and watch lists on all your devices. \n- Private backup for portfolios and watch lists. \n- Search for stocks, ETFs, mutual funds, indexes, world currencies and more. \n- Fast and smooth user interface. Optimized for the Retina display and iOS 9, and takes full advantage of the new multicore processing power of the iPad and the iPhone. \n- Unique chart viewer (now full screen by popular demand). From intraday to inception day, or anywhere in between, configure the chart scale (log or linear), chart type (candle, bar or line) and volume for all your watch lists in one go. \n- 140+ news feeds from reliable news sources. \n- World currencies. See any currency over time, or its current value against any other. \n- View the US stock market grouped by sector and industry. \n- Richly detailed view of each company, organized in eight sections: Numbers, Earnings Estimates**, Dividend History**, Competitors**, Technicals, Events, Tweets and News. \n- We are very proud of our data quality.\n\n-- PORTFOLIO HIGHLIGHTS \nTransaction-based portfolios are a hassle to enter and maintain. Stocks Live uses a more practical way to manage portfolios. Just enter the latest positions you have, and never worry about buy and sell transactions. Update Stocks Live whenever your portfolio changes--it's as simple as that. \n- Free sync & trade with major brokers (including coinbase).\n- Play What-If scenarios with your portfolios. \n- Multi-currency support aggregated to your local currency settings or per portfolio currency. \n- Alert if your portfolio is higher or lower than a certain threshold. \n- Benchmark each portfolio against any ticker. \n- Passcode protection with Touch ID. \n- Support long, short, RSUs and employee stock options. \n- Support for stocks and put\/call options. \n- Support copy\/paste for easier data entry. \n- Short-term and long-term performance calculation. \n- Display the number of days until a short-term holding becomes a long-term holding. \n\n-- MANY THANKS TO \n- The Special Advisers Team:Yuri Belorusets and Yoni Miller. \n- The Eagle-Eyed Man (also French translation): Pierre Louveaux. \n- Japanese Translation: Mayumi Takeda. \n- Portfolio Advisor: Dr. Shehab Marzban \n\n* real-time is for all Nasdaq, NYSE, some companies in UK, German, French companies & Netherland, in-app purchase required. \n** In-app purchase required.\nBest iPhone stocks app.",
