		"TBAppDescription": "iStock --- Sweet iPhone Stock App \n\nAs a professional equity investor, would you need a sweet app that whenever you need it, it can tell you information of any stocks or indices of all over the world as well as their trend analysis? As an iPhone fans, do you wanna a stock app whose designed style and philosophy are of the Apple original ecological type? \n\niStock is a stock quote query and analysis software. It is concise, powerful and easy to use, which is an essential tool for stock investors. \n\nToday, we grandly launched version 2.3, which is mainly for the Chinese mainland stock market (A shares or B shares) as well as the United States, Hong Kong and other major global stock markets. You can see stocks from the localized Chinese mainland stock market, and also stock information of almost any company listed worldwide. \n\n\u2022 The list of features\n\nThis version is mainly for China stock market (A shares and B shares) as well as the United States, Hong Kong and other major global stock markets. \n\na) Watchlist: \nAdd unlimited symbols to exsiting watchlist \nAdd or delete your symbols in watchlist \nReal-time quotes \nSort by price change percent \nPull down table list to refresh data \n\nb) Stock details: \nLast Trade,Trade Time,Change,% Change,Prev.Close,Open,Day Range,52wk Range,Bid,Ask,Vol.,1Y Target,Mkt Cap,P\/E,EPS,P\/B,P\/S,Dividend,etc. \n\nc) Stock news: \nStocks real-time financial news, covering all A shares and B shares, you can see the company trends at the first time \n\nd) Research report: \nLatest Stock Research report (A shares and B shares) from various of agencies in China and abroad \n\ne) Market: \nLocalized China mainland stock market \nChina main stock market indices \nIndustry indices, Stock quote details \nTop-20 gainers and losers price change list of A shares \nTop-20 five minutes price change speed list \nLately listed stock list \nWorld's major stock markets \n\nf) Sectors: \nSector management categorized by sub-industry, concept and region, the capital flows information and sector stocks management \n\ng) Category management: \nQuery stocks categorized by Shanghai, Shenzhen, small plates and the GEM. And also full lists of all stock indices, warrants and closed-end funds,etc. \n\nh) Chart: \nSimple line\/candle chart \n1,5 day, 3,6 month and 1,2,5 year chart \nSimply rotate device from single stock view \nZoom in and out on the charts display by pinching your fingers \nTap the charts view to display time horizon option bar \n\ni) News: \nAccess real time breaking news and top stories from market \n\nj) China concept stocks: \nSupport China stocks listed on NASDAQ and the NYSE Real-Time Quotes and Chart View \n\nk) Paging Features: \nPull table list to refresh, pull down for the previous and drag up for the next page, E-book-style-jump to specified page \n\nl) Settings: \nAuto-Fetch - Multiple intervals to choose from \nColor settings for rising stocks \n\nm) Support devices: \nAll iOS devices are fully supported. \n\n\u2022 Your ratings and reviews are always helpful. Thanks for using iStock.",
