		"TBAppDescription": "Works with Evernote, Salesforce and other CRMs. Scan cards in seconds or submit tricky cards for 100% accurate human transcription!\n\nKEY BENEFITS\n* Keep your CRM up-to-date with direct card export to Salesforce, SugarCRM and others. \n* Export via CSV\n* Evernote integration--upload card images to Evernote\n* Easily add contacts to iPhone address book\n* Create new contacts or merge scans with existing records\n* Create new contacts with email signatures\n* Scan both sides of card--never lose a note!\n* Scan in any direction--it detects text automatically\n* Manual transcription available for hard-to-read cards (2 free included, then additional credits available starting from 50 Manual Transcription credits for $10)\n\nADDITIONAL FEATURES\n* Assign contact to group\/add new groups\n* Add notes to each contact\n* Forward contacts to colleagues (text, image and VCard)\n* Send instant email and your VCard to new contact\n* Search and sort cards with cover flow 3D view\n* Compatible with ScanBizCards Enterprise (available on the Salesforce AppExchange)\n\nAWARDS AND REVIEWS\n\u201cPretty amazing stuff\u201d [Apple Gazette]\n\u201cBringing order to the chaos of business card collection\u201d [New York Times]\n\"ScanBizCards offers its users a vast array of features - straightforward and user-friendly\"\n[148Apps review]\n\"ScanBizCards: use your iPhone 3GS to organize your collection of business cards\"[TechCrunch]\nWinner of the 2011 MOBI Award [Sept 21, 2011]\nAppy Awards finalist [February 2011]\nFeatured on ABC TV\n\nLANGUAGE SUPPORT (21 languages)\nCzech, Danish, English, German, Finnish, French, Hungarian, Italian, Lithuanian, Dutch, Norwegian, Polish, Portuguese, Romanian, Slovakian, Spanish, Serbian, Swedish, Turkish, Vietnamese \n\nMORE\nScanBizCards is the favorite business card reader with reviewers because it doesn't just scan cards into the address book (better than other apps) - but goes much beyond, offering over 27 premium features not included in ANY other business card scanner. \n\nFor more information please visit https:\/\/www.circleback.com\/apps\/scanbizcards\/ or email us at sbcsupport@circleback.zendesk.com",
