		"TBAppIcon": "https:\/\/is2-ssl.mzstatic.com\/image\/thumb\/Purple69\/v4\/38\/05\/2c\/38052c96-550e-2d69-832c-7186c8f015e8\/source\/60x60bb.jpg",
		"TBAppDescription": "Following the epic storylines of Jurassic Park, The Lost World: Jurassic Park and Jurassic Park III, as well as the global smash hit Jurassic World, LEGO Jurassic World\u2122 is the first videogame where you can relive and experience all four colossal films. Reimagined in LEGO form and told in TT Games\u2019 signature classic LEGO humor, this thrilling adventure recreates unforgettable scenes and action sequences from the films, allowing fans worldwide to play through key moments and giving them the opportunity to fully explore the expansive grounds of Isla Nublar and Isla Sorna.\n\nFEATURES\n-Relive key moments from all four Jurassic films: An adventure 65 million years in the making - now in classic LEGO brick fun!\n-Wreak havoc as LEGO dinosaurs: Choose from 16 dinosaurs, including the friendly Triceratops, deadly Raptor, vicious Compy and even the mighty T. rex.\n-Customize your own dinosaur collection: Collect LEGO amber and experiment with DNA to create completely original dinosaurs, like the Dilophosaurus rex.\n-Populate and explore Isla Nublar and Isla Sorna: Put your unique dinosaur creations in to paddocks as you complete special Free Play missions.",
