		"TBAppDescription": "AN OFFICIAL ELF ON THE SHELF\u00ae APP\n\nCollect enough Christmas spirit while running across fun, spirited courses in Elf Pets\u00ae Pup! \n\nPlay as the virtual Elf Pets\u00ae Saint Bernard pup and help Santa keep the North Pole magical! Race through six exciting obstacle courses and special level bonuses, while making sure to avoid obstacles!\n\nBe generous and lend a helping hand, like feeding or washing your dog. Generate Christmas spirit and unlock six unique Spirit Run levels. Earn Virtual Care Badges\u2122 as you care for your dog and gather Christmas spirit, and show you\u2019re doing your part to help Santa keep the North Pole magical!\n\nThe Elf Pets\u00ae Pup Features:\n\nVIRTUAL ACTS OF KINDNESS\n\u2014 Feed and wash your virtual Elf Pets\u00ae Pup.\n\u2014 Lend a helping hand in fun object matching games.\n\u2014 Help Santa by putting your sorting skills to the test in challenging sorting games.\n\nUNLOCK OBSTACLE COURSES\n\u2014 Complete virtual kind deeds to unlock themed spirit runs!\n\u2014 Race across: Training Run, Ice Run, Night Run, Blizzard Run, Mountain Run and Sky Run.\n\u2014 Tap to jump over obstacles, collect special bonuses and gather all the Christmas spirit generated by acts of kindness!\n\nCARE BADGES\u2122\n\u2014 Earn badges for taking care of your virtual Elf Pets\u00ae Saint Bernard and completing virtual kind deeds!\n\u2014 Gathering Care Badges\u2122 will help your pup gather Christmas spirit for Santa!\n\u2014 You can also claim Care Badges\u2122 that represent moments you\u2019ve experienced with your real-life Saint Bernard pup.\n\nPlay as the virtual Elf Pets\u00ae Saint Bernard pup and run across six exciting obstacle courses! Collect enough Christmas spirit to help Santa keep the North Pole magical in Elf Pets\u00ae Pup!\n\nDownload now to start helping Santa with his dog!",
