		"TBAppDescription": "-This is an indie game and is an ARPG dungeon game. It has a lot of playable elements.\n-The pixel is combined with the physics engine, so it has a powerful and unique combat system. Here you need precise walking, skilled counterattacks, skill coordination and the use of elements.\n\n[Element system]\n\tThere are six elements in the dungeon: fire, ice, thunder, poison, holy and dark. There is a relationship between the elements. Most skills are formed by one of these six elements.\n\tWith elements you can increase the attack power of the same attribute skill. Increases damage to enemies with restrained attributes. Even promote or reduce your own attribute defense. If you can use the elements flexibly, you can make yourself stronger.\n\n [Weapons & Skills]\n\tWeapon category: a variety of magical weapons with unique skills. Swords, spears, epes, trenches, etc. have their own characteristics.\n\tMagic Skills:\n\t-Black magic skills have a wide range of attacks.\n\t-Enchanted magic can enchant weapons, increase weapon attack power, and even increase weapons Debuff.\n\t-White magic has a variety of effects. Such as restoring life and even changing the position of the enemy.\n\t\n[Combat System]\n\tEverything is based on the physics engine, which has a rich variety of forces.\n\tMagic Skills:Black holes, tornadoes, etc. can attract enemies and even other skills, and have a strong interaction.\n\t\n\tMelee Weapons:This is an important weapon for you to have powerful operations.\n\t-You can use it to attack monsters, hit monsters, dash.\n\t-You can even use a melee weapon to launch a more powerful magic counterattack. You can directly counter the enemy or most of your magic skills and increase the attack rate.\n\n[Map System]\n\tA large number of maps in battle will appear randomly in front of you.\n\tAs you continue to dive in dungeons, you will be exposed to a variety of dungeons. There will be different challenges.\n\t-There are all kinds of destruction that can be destroyed, such as a small altar that can release great magic, various signs that give you instructions, various elements that can be collected, etc.\n\t-The walls in the map are the entities that can be hit. Let you feel the ubiquitous blow\n\n[Sprite System]\n\tIn the dark dungeons, there is a bright light source, and that is the sprite who always accompanies you.\n\tThey not only provide you with a light source, but also help you withstand attacks.\n\n**If you like dungeon games, like a sense of percussion, like a combination of high freedom skills. This is definitely a game you should not miss. Let's fight for the endless dark dungeon~",
